import React, { Component } from 'react'
import '../index.css'
export default class Square extends Component {
    state={
        value:null
    }
    handleClick=()=>{
        this.setState({
            value:"X"
        })
    }
    render() {
        return (
            <button className="square" onClick={()=>this.handleClick}>
                {this.state.value}
            </button>
        )
    }
}
